eval("module.exports = JSON.parse('{\"en\":{\"main_title\":\"The Petit Trianon\",\"title\":\"The Petit Trianon\",\"years\":\"1762-1768\",\"text1\":\"The Petit Trianon was built between 1763 and 1768 by the architect Gabriel, requested by Madame de Pompadour, mistress then friend of king Louis XV. Mme de Pompadour was the former mistress of the king but still his friend. She was the instigator of this little palace, built by Gabriel from 1763 to 1768 near the botanical gardens and the new menagerie to entertain him with one of his passions : sciences.\",\"text2\":\"Even inside we find a modern style. The decoration of the Small Trianon is more simple than the rest of the estate. It is not about materials, you will notice the absence of gold for example, but more about the fineness and elegance of the sculptures dedicate, like the palace, to nature.\",\"text3\":\"Nowadays it keeps the souvenir of an other inhabitant : Louis XVI made a gift of the Trianon Estate to his queen Marie-Antoinette in 1774. She lived there a distant life from the court, maybe too distant for some of the courtier.\"},\"ua\":{\"main_title\":\"Маленький Тріанон\",\"title\":\"Маленький Тріанон\",\"years\":\"1762-1768\",\"text1\":\"Маленький Тріанон був побудований між 1763 і 1768 рр. архітектором Габріелем на замовлення мадам де Помпадур, коханки тодішнього друга короля Людовика XV. Пані де Помпадур була колишньою коханкою короля, але все ще його подругою. Вона була натхненник цього маленького палацу, побудованого Габріелем з 1763 по 1768 рік поблизу ботанічних садів і нового звіринця, щоб розважити його однією зі своїх пристрастей: науками.\",\"text2\":\"Навіть всередині ми знаходимо сучасний стиль. Оздоблення Малого Тріанону простіше, ніж решта садиби. Мова йде не про матеріали, ви помітите, наприклад, відсутність золота, а більше про тонку і витонченість скульптур присвячує, як і палац, природі.\",\"text3\":\"Нині тут зберігається сувенір іншого мешканця: Людовик XVI подарував маєток Тріанон своїй королеві Марії-Антуанетті у 1774 році. придворний.\"},\"es\":{\"main_title\":\"El Pequeño Trianón\",\"title\":\"El Pequeño Trianón\",\"years\":\"1762-1768\",\"text1\":\"El Petit Trianon fue construido entre 1763 y 1768 por el arquitecto Gabriel, por encargo de Madame de Pompadour, amante entonces amiga del rey Luis XV. Madame de Pompadour fue la antigua amante del rey pero todavía su amiga. Era el impulsor de este pequeño palacio, construido por Gabriel de 1763 a 1768 cerca de los jardines botánicos y la nueva casa de fieras para entretenerlo con una de sus pasiones: las ciencias.\",\"text2\":\"Incluso en el interior encontramos un estilo moderno. La decoración del Pequeño Trianón es más sencilla que la del resto de la finca. No se trata de materiales, notarás la ausencia de oro por ejemplo, sino más bien de la finura. y elegancia de las esculturas dedicadas, como el palacio, a la naturaleza.\",\"text3\":\"Hoy en día guarda el recuerdo de otro habitante: Luis XVI hizo un regalo del Trianon Estate a su reina María Antonieta en 1774. Ella vivió allí una vida distante de la corte, tal vez demasiado distante para algunos de los cortesano.\"}}');\n\n//# sourceURL=webpack:///./content/architecture/exemple/petit-trianon.json?");

